Here is a sample Python program that prints the first 100 prime numbers:
```
def is_prime(n):
    if n <= 1:
        return False
    for i in range(2, int(n ** 0.5) + 1):
        if n % i == 0:
            return False
    return True

for i in range(2, 101):
    if is_prime(i):
        print(i)
```
This program uses the `is_prime` function to check whether a number is prime. The function checks whether the number is divisible by any number between 2 and the square root of the number. If it is not divisible, then it is considered prime.

The program then loops through the numbers from 2 to 100 and prints out the ones that are prime using the `is_prime` function.
